import Navbar from './Navbar';

function App() {

  let Component

  switch (window.location.pathname) {
    case "/":
      Component = App
      break
    case "/pricing":
      Component = Pricing
      break
    case "/about":
      Component = About
    break

  }

  return (
    <>
      <Navbar />
      <Component/>
    </>
  );
}

export default App;
